import "./Header.css";

const Header = () => {
  return (
    <header>
      <div className="header--logo">
        <a href="/">
          <img
            src="https://upload.wikimedia.org/wikipedia/commons/1/15/Logonfx.png"
            alt="sem conecção"
          ></img>
        </a>
      </div>
      <div className="header--user"></div>
    </header>
  );
};

export default Header;
